import React from "react";

const Footer = () => {
  return (
    <div className="note-app__footer">
      <center>
        Copyright &#169;2023,{" "}
        <a
          className="link"
          target="_blank"
          rel="noopener noreferrer"
          href="https://github.com/adhidevara"
        >
          Muh Thoriq AS
        </a>{" "}
      </center>
    </div>
  );
};

export default Footer;
